INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001, "お！\nあそこに困ってそうな人発見！", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "春咲 ひより");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002, "大切な人を\n守れるようになりたい…って", 0, "みんなみたいに\nわたしも強くならなきゃ", 0, "草野 優衣");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "少しは磨かれると思いますよ。", 1003, "キミに必要な集中力と感性が", 0, "フェンシングを始めてみては？", 0, "士条 怜");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1004, "今日はなにして遊ぶ？", 0, "ねぇ、にいちゃん！", 0, "穂高 みそぎ");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "私といっしょに…\nいかない？", 1006, "ねぇ…", 0, "風宮あかりです", 0, "風宮 あかり");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "食べ物の恨みは怖いのー", 1007, "プリンたべたいのー", 0, "出雲宮子なのー", 0, "出雲 宮子");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "いいよ。\n見られることは運命さ…", 1008, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "ボクは虹村雪。", 0, "虹村 雪");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "人呼んで「疾風の冥姫」!!", 1009, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "フッ…聞いて後悔するがいい！", 0, "柊杏奈");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "ほんまおおきにやわ～♪", 1010, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, "姫宮 真歩");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "ここで会ったが\n100年目～！", 1011, "生き別れたお兄ちゃんを探して\n三千世界！", 0, "衣之咲璃乃です！", 0, "衣之咲 璃乃");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1012, "ち、超能力って…\n何のことかな～？", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "柏崎 初音");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016, "一応カリスマ読モJKやってまっす！", 0, "ちょす！\n美波鈴奈だよ～♪", 0, "美波 鈴奈");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "でも、沖縄もとってもいいとこさー", 1017, "東京は遊園地みたいなところさー", 0, "はいたーい。\n喜屋武香織さー。", 0, "喜屋武 香織");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "イオちゃんって呼んでね。", 1018, "先生って呼ばれるのは\nくすぐったいから", 0, "支倉伊緒です。", 0, "支倉 伊緒");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "ミミをおいてかないでぇ～", 1020, "あ！/\お兄ちゃ～ん\nまってよ～", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "茜 ミミ");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "ふぇぇぇぇぇん……", 1021, "あの……\nふぇ……", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "栗林 くるみ");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "なんてありがとうございます！", 1022, "こんな私に貴重な時間を\n割いていただき、", 0, "風宮よりです。\nあああああ！", 0, "風宮 より");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "私こっち行きたいー\nね、早く早くー", 1023, "おにいちゃんどこいくの？\nえ？", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "北条 綾音");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "これて何か違う…\nあああすみません！", 1025, "ふ、不束者ですが\nどうぞ末永く…って、", 0, "わっ…わっ…私、\n天野すずめといいます！", 0, "天野 すずめ");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "離しませんわ………\n絶対に…!!", 1027, "あなたは…運命の……\n伴侶……", 0, "……クスクス…私は\n…倉石恵理子……", 0, "倉石 恵理子");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "…そうでしょ？？", 1028, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "佐々木 咲恋");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "あはは、\n私もまだまだだなぁ～", 1029, "ぇっと…\nキミ、私のこと知らないの?!", 0, "桜井望だよ！\nよろしくねっ", 0, "桜井 望");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1030, "初めまして、\n私はニノン・ジュベール申すデス！", 0, "デケデケデンっ！", 0, "ニノン・ジュベール");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "おかしいですね……", 1031, "でもって私の隣にいるのが……\nえ、見えない？", 0, "上喜しのぶです。\n手元のドクロが父です。", 0, "上喜 しのぶ");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "そう、\nオラのボケに突っ込める相方が…！", 1033, "けんども\nそれには足りないモンが…", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, "野戸まひる");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "ちょ\nちょっと一杯飲んできます…！", 1034, "ちょっと緊張しちゃって…", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "綾瀬 ゆかり");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "これ以上お話しすることは…\nないです！", 1036, "知らない人とは話しちゃいけないので", 0, "氷川鏡華…です", 0, "氷川 鏡華");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038, "……あ、アラーム。", 0, "柏崎…栞です。", 0, "柏崎 栞");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "野に咲く花が、\n唯一の話相手です。", 1040, "私、一人も友達がいなくて……", 0, "ふ、双葉碧です。", 0, "双葉 碧");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "そう思っています。", 1042, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "三角千歌です。", 0, "三角 千歌");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "う、疑ってすまなかったな…", 1043, "あぁ？\nお前のそいつの仲間か？", 0, "安芸真琴だ。", 0, "安芸 真琴");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044, "生けとし生ける全ての者よ！", 0, "わらわこそは夜を総べる者！", 0, "イリヤ・オーンスタイン");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "ｌク、クウカに何かご用ですか!?", 1045, "ぐふふふふ……はっ！", 0, "そこで騎士は妖精を乱暴に……", 0, "遠見 空花");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1046, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "宮坂たまき");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048, "それでは早速クエストに…", 0, "大神美冬よ！", 0, "大神 美冬");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049, "クエストもバトルも\n掃除も洗濯も", 0, "星野静流だよ！", 0, "星野静流");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050, "見ての通りの\nセクシー美少女で", 0, "アタシは玉泉美咲。", 0, "玉泉美咲");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.4, 0, 2, 1, 0, 1, 1, 0, "？？？？", 1052, "？？？？", 0, "？？？", 0, "リマ");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "そ、そこまでいうなら\nもらってやる", 1053, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィントだ。", 0, "モニカ・ヴァイスヴィント");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "そ、そこまでいうなら\nもらってやる", 1058, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィントだ。", 0, "ペコリーヌ");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "そ、そこまでいうなら\nもらってやる", 1059, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィントだ。", 0, "コッコロ");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1.5, 0, 2, 1, 0, 1, 1, 0, "そ、そこまでいうなら\nもらってやる", 1060, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィントだ。", 0, "キャル");
